ss and Excellence in Service and Soundness. Using the Balanced Scorecard architecture, ACCESS comprises 86 indicators on four perspectives of credit union operations &ndash; finance, learning and growth, customer-member and internal business processes. At this training, ACCU is building the capacity of its member organizations to carry out quality assurance review of credit unions undergoing ACCESS accreditation. </span><span style="font-size: 11pt; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;; font-weight: normal;"><o:p></o:p></span></p>\r\n</p>', 'up comming', '', '', 1),
