mber organizations brought about changes in the ways cooperative regulators support credit union development. This was evident in the way regulators see the role of the national federations as partners in promoting prudential norms for credit unions and demonstrates new development possibilities, in which member organizations of ACCU are the leading actors.</span><span style="font-size: 11pt; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;; font-weight: normal;"> The conference is a platform created by ACCU for its members and their regulators to discuss regulatory issues and requirements of credit unions. <o:p></o:p></span></p>\r\n<p>\r\n<meta content="text/html; charset=utf-8" http-equiv="Content-Type" />\r\n<meta content="Word.Document" name="ProgId" />\r\n<meta content="Microsoft Word 12" name="Generator" />\r\n<meta content="Microsoft Word 12" name="Originator" />\r\n<link href="file:///G:\\DOCUME~1\\User1\\LOCALS~1\\Temp\\msohtmlclip1\\01\\clip_filelist.xml" rel="File-List" />\r\n<link href="file:///G:\\DOCUME~1\\User1\\LOCALS~1\\Temp\\msohtmlclip1\\01\\clip_themedata.thmx" rel="themeData" />\r\n<link href="file:///G:\\DOCUME~1\\User1\\LOCALS~1\\Temp\\msohtmlclip1\\01\\clip_colorschememapping.xml" rel="colorSchemeMapping" /><!--[if gte mso 9]><xml>\r\n<w:LatentStyles DefLockedState="false" DefUnhideWhenUsed="true"\r\nDefSemiHidden="true" DefQFormat="false" DefPriority="99"\r\nLatentStyleCount="267">\r\n<w:LsdException Locked="false" Priority="0" SemiHidden="false"\r\nUnhideWhenUsed="false" QFormat="true" Name="Normal" />\r\n<w:LsdException Locked="false" Priority="9" SemiHidden="false"\r\nUnhideWhenUsed="false" QFormat="true" Name="heading 1" />\r\n<w:LsdException Locked="false" Priority="9" QFormat="true" Name="heading 2" />\r\n<w:LsdException Locked="false" Priority="9" QFormat="true" Name="heading 3" />\r\n<w:LsdException Locked="false" Priority="9" QFormat="true" Name="heading 4" />\r\n<w:LsdException Locked="false" Priority="9" QFormat="true" Name="